DROP TABLE wn_synset
CREATE TABLE  wn_synset (synset_id decimal(10,0) NOT NULL default '0',  w_num decimal(10,0) NOT NULL default '0',  word varchar(50) default NULL,  ss_type char(2) default NULL,  sense_number decimal(10,0) NOT NULL default '0',tag_count decimal(10,0) default NULL);

DELETE FROM wn_synset WHERE word LIKE '%\_%' ESCAPE '\';


